import { Box } from '@mui/material'
import React from 'react'
import Select from '../SelectButton/SelectButton'

function SubHeader() {

    const home = [
        'Home',
        'Best Offers',
        'up-coming offers',
        'new products',
        'best sell',
        'Mobiles',
        'laptops',
        'smart watches'
    ]
    return (
        <Box sx={{
            width: '100%',
            pt: 11.3
        }}>
            <Box sx={{
                bgcolor: 'lightgrey',
            }}>
                <Select categorys={home} />
            </Box>
        </Box>
    )
}

export default SubHeader
